		"lang": "ko",
		"text": "EP5의 음악은 단 한대의 건반을 매개로 여러 장르가 결합된다는 것이 가장 큰 특징일 것입니다. 우리는 EP5의 음악을 들으며 신나게 춤을 출 수도 눈을 감고서 꿈꾸는 듯한 어떤 이미지를 상상할 수도 있습니다. 누구나 함께하는 파란만장에서 EP5의 음악세계를 자유롭게 여행하시기 바랍니다."
